INSERT INTO `bim_tbl_flashnews` (`id`, `judul`, `isi`, `status`, `created_at`, `created_by`) VALUES
	(1, 'Kompetisi BIM Internasional 2020', 'BIM PT PP Divisi Infrastruktur 1 melalui Proyek Jalan Tol Manado Bitung mendapatkan TOP 3 di Kompetisi Internasional dalam Autodesk Excellence Competition Awards 2020. ', 'Active', '2020-11-04 04:26:32', 103),
	(2, 'Startegi BIM Divisi', 'Tahun depan dalam menghadapi persaingan bisnis dan memperkuat kinerja perusahaan, BIM PT PP Divisi Infrastruktur 1 akan mulai membuat program BIM & Engineering Center sebagai salah satu program strategi unit di tahun 2021.', 'Active', '2020-11-04 04:25:41', 103);
